window.bookSummaryJSON = "<p><b>Caught in a war between the living and the dead, which side will Maxine choose?</b></p> <p>Boston, 1897</p> <p>Death’s arrival in Boston was heralded by a crimson moon and screams in the night. The vampire king will claim what he wants in the city, unless someone is brave enough to stop him....</p> <p>Maxine Parker’s life is an agonizingly solitary one, and not by choice. life. Her empathic ability renders it impossible for her to touch a living soul without killing them. But she cannot kill what is already dead.</p> <p>Thrust into the middle of a war between the vampire king and three stalwart hunters, she finds herself drawn to Dracula’s alluring seduction. Giving in to her attraction to him would mark the end of her life. Will that be the sacrifice required to save the people of Boston from the plague of death closing in on them?</p> <p><i>Dark fantasy and gothic romance blend seamlessly with horror in this gripping pause-resister.</i></p>"; 
